Allows for environment vars to be passed through config as they would look in the command line.

``` json
{
    "default": {
        "port": "$PORT"
    }
}
```

This will become whatever environment var is stored in port. Otherwise, `$PORT` as a string will be returned.

Considering:
- Throw an error if the environment variable isn't found?
- Have some sort of a "default" syntax, like `"$PORT:80"` where 80 becomes the default.
